      FertilizerRequirement: "5 kg of Nitrogen (12 kg of Urea), 8kg of P2O5 (50 kg of Superphosphate) should be applied per acre at time of sowing when seeds are inoculated with rhizobium culture. In case, seeds are not inoculated with rhizobium, doubled the dose of P2O5.",
