      FertilizerRequirement: "At the time of field preparation, apply well decomposed cow dung@150 qtl/acre in soil. Apply N:P:K@10:10:10 kg/acre in form of Urea@25 kg/acre, SSP@60 kg/acre and MOP@16 kg/acre. Full dose of Potash and Phosphorus are applied at time of rhizome planting. Nitrogen dose is given in two equal splits. First half dose of N is given 75 days after planting and remaining half dose is given three month after planting.  ",
      AreaUnderCrop: "5.6",
