      HarvestSeason: "July to Sep",
      Diseases: "Graphiola leaf spot: They are caused by fungus under humid conditions. Gray color spots are observed on both sides of leaves.\r\n\r\nTo control this disease take foliar spray of Copper Oxychloride@3gm/Ltr of water or Mancozeb@2gm/Ltr of water.\r\n\r\nAlternaria leaf blight: If infestation is observed, take spray of Mancozeb + Carbendazim@2gm/Ltr of water. Take second spray with interval of 15 days. ",
      InsectDisease:'Termites',
      SuitableAreasInPakistan: "Khairpur /Sukkur in Sindh\r\nTurbat /Panjgur in Balochistan\r\nD I Khan in KPK, and\r\nMuzaffar Garh & Jhang in Punjab.",
      Insects: "Termites: These pests attack on the roots of the plants. For termite control apply Chlorpyrifos through drip irrigation.\r\n\r\nTo control termites, mix 800ml chlorpyrifos in 150 ltr of water and apply in the roots of the plants.\r\n\r\nLesser Date Moth: As a preventive measure, take two spray of Deltamethrin@2ml/Ltr of water with interval of 15 days. Take first spray at fruit bearing stage.\r\n\r\nBird: When crop reaches in doka stage, fruits are damaged by bird. Cover bunch with thin wire net.",
      FertilizerRequirement: "In September to October month, application of FYM@10-15kg to young plants and 30-40kg per tree to mature plant is done. Urea@4.4kg is applied on one year plant to mature tree. Application of urea is done in two equal splits, first dose is given before flowering and the remaining half dose is given after fruit set is done in April.",
